import React from "react";

const Rank = ({ nameProp, entriesProp }) => {
  return (
    <div>
      <div className="white f3 blue">
        {`${nameProp}, your current entry count is...`}
      </div>
      <div className="white f1 blue">{entriesProp}</div>
    </div>
  );
};

export default Rank;
